    #             x = f/215;
    #             S = 1e-49 * (x.^(-4.14) - 5*x.^(-2) + 111*(1 - x.^2 + 0.5*x.^4)./(1+0.5*x.^2)); 
    #             fstop = [9 Inf];        
    #         elseif (length(IFO)>6) && (strcmpi(IFO(1:6),'ALIGO-'))
    #             [S, fstop] = aligospectrum(IFO,f);
    #         elseif (length(IFO)>11) && (strcmpi(IFO(1:11),'ALIGOEARLY-'))
    #             [S, fstop] = aligoearlyspectrum(IFO,f);
    #         elseif (length(IFO)>7) && (strcmpi(IFO(1:7),'AVIRGO-'))
    #             [S, fstop] = avirgospectrum(IFO,f);
    #         elseif (length(IFO)>=5) && (strcmpi(IFO(1:5),'WHITE'))
    #             fs = str2num(IFO(6:end));
    #             fstop = [f(1),f(end)];
    #             S = 2 * ones(size(f)) / fs;
    #         else
    #             error(['Detector ' IFO ' not recognized.']);
    #         end


    #% ---- Display warning message if asking for spectrum at frequencies below
