# % -------------------------------------------------------------------------
# %                              ET-B SRD
# % -------------------------------------------------------------------------
# function[sqrtS, fstop] = ETB_fit(f)
# % ETB_fit - simple fit to the "ET-B" sensitivity curve of arXiv:0810.0604v2 
# % 
# % [sqrtS, fstop] = ETB_fit(f)
# %
# %   f       Vector of sampled frequencies (Hz).
# %
# %   S       Vector of the same shape as f, containing amplitude spectral 
# %           densities of ET_B (1/sqrt(Hz)).
# %   fstop   Minimum frequency (Hz) at which fit is "guaranteed" to be
# %           accurate.
# %
# % ETB_fit provides a simple fit to the "ET-B" design noise spectrum curve
# % described in arXiv:0810.0604v2.  For data see 
# %   https://workarea.et-gw.eu/et/WG3-Topology 
# % The following analytic approximation is good to within 10% across the
# % [1,10000] Hz band.  Compared to the sampled spectrum, the analytic
# % approximation Sanal has the properties 
# %        min((Sanal/S).^0.5)  = 0.90
# %        mean((Sanal/S).^0.5) = 0.95
# %        min((Sanal/S).^0.5)  = 1.03
# %
# % Created by Thomas Dent (thomas.dent@astro.cf.ac.uk) on 14/05/09

xt = f/100.
fit = 2.39*10**(-27)*xt**(-15.64) +0.349*xt**(-2.145) +1.76*xt**(-0.12) +0.409*xt**(1.10)
sqrtS = 10**(-25)*fit
fstop = [1,float('inf')]  #%-- chosen arbitrarily -- looks okay.


